import { createClient } from "@supabase/supabase-js";
import { OpenAIEmbeddings } from "langchain/embeddings/openai";
import { SupabaseVectorStore } from "langchain/vectorstores/supabase";

const supabaseUrl = process.env.SUPABASE_URL || "";
const supabaseKey = process.env.SUPABASE_SERVICE_ROLE_KEY || "";

if (!supabaseUrl) throw new Error("Missing env var SUPABASE_URL");
if (!supabaseKey) throw new Error("Missing env var SUPABASE_SERVICE_ROLE_KEY");

const client = createClient(supabaseUrl, supabaseKey);

export const run = async () => {
  // Create a vector store through any method available to Langchain
  const vectorStore = await SupabaseVectorStore.fromTexts(
    ["Hello world", "Bye bye", "hello nice world"],
    [{ id: 2 }, { id: 1 }, { id: 3 }],
    new OpenAIEmbeddings(),
    {
      client,
      tableName: "documents",
      queryName: "match_documents",
    }
  );

  // Search for the most similar document
  const results = await vectorStore.similaritySearch("hello world", 1);
  console.log(results);

  /*
  [ Document { pageContent: 'Hello world', metadata: { id: 2 } } ]
  */

  // Update a document in the vector store
  await vectorStore.updateDocuments(
    ["Hello World"],
    [{ id: 4 }],
    new OpenAIEmbeddings(),
    {
      client,
      tableName: "documents",
      queryName: "match_documents",
    }
  );

  // Search for the most similar document again
  const results2 = await vectorStore.similaritySearch("hello world", 1);
  console.log(results2);

  /*
  [ Document { pageContent: 'Hello World', metadata: { id: 4 } } ]
  */

  // Delete a document from the vector store
  await vectorStore.deleteDocuments(["id"], [{ id: 4 }]);
};

run();
